function [timeVec, chspec_ni_vec, chavg_ni_vec] = getEEG_NoiseAnalysis(fs, mtgLabels, mtgSignals, notched, notchFreqs)

    nSamples = size(mtgSignals,2);
    nrMtgs = size(mtgLabels,1);
    stepSize = fs*10;
    wdwSize = fs*10;
    ssVec = 1:stepSize:nSamples-wdwSize;
    timeVec = zeros(1, length(ssVec));
    chavg_ni_vec = zeros(1, length(ssVec));
    chspec_ni_vec = zeros(nrMtgs, length(ssVec));

    clc;
    polyOrder = 10;

    notchWidth = 5;
    harmonFreqs = [notchFreqs - notchWidth, notchFreqs + notchWidth];

    for si = 1:length(ssVec)
        startSample = ssVec(si);
        endSample = startSample+wdwSize-1;
        timestamp = (startSample-1)/fs;
        dataWin = mtgSignals(:, startSample:endSample);

        channSpecNI = getPerfChannSpecNoiseIdx(fs, startSample, mtgLabels, dataWin, polyOrder, notched, harmonFreqs);

        chspec_ni_vec(:,si) = channSpecNI;
        chavg_ni_vec(si) = mean(channSpecNI);%chAvgNI;
        timeVec(si) = timestamp;
    end
end

function channSpecNI = getPerfChannSpecNoiseIdx(fs, startSample, mtgLabels, dataWin, polyOrder, notched, harmonFreqs)
    
    nSamples = size(dataWin,2);
    nrMtgs = size(mtgLabels,1);
    fftFreqs = fs*(0:(nSamples/2))/nSamples;
    delSel = (fftFreqs < 1) | (fftFreqs > 341.33);

    if notched
        for hfi = 1:length(harmonFreqs)
            pwlFreqL = harmonFreqs(hfi,1);
            pwlFreqH = harmonFreqs(hfi,2);
            selVec = fftFreqs >= pwlFreqL & fftFreqs <= pwlFreqH;
            delSel(selVec) = true;
        end
    end
    fftFreqs(delSel) = [];
    time = startSample/fs + (0:length(dataWin)-1)/fs;

    %% Get ideal spectrum
    [perfDataFreqs, perfDataModel] = getPerfEEGChannAvg_RegressionVals();
    delSel = false(length(perfDataFreqs),1);
    if notched
        for hfi = 1:length(harmonFreqs)
            pwlFreqL = harmonFreqs(hfi,1);
            pwlFreqH = harmonFreqs(hfi,2);
            selVec = perfDataFreqs >= pwlFreqL & perfDataFreqs <= pwlFreqH;
            delSel(selVec) = true;
        end
    end
    perfDataModel(delSel) = [];

    %% Get ChannSpec and ChannAvg Spectrum Regression
    avgDataSpctrm = zeros(1, length(fftFreqs));
    chDataSpctrmMat = zeros(nrMtgs, length(fftFreqs));
    for mi = 1:nrMtgs
        %Chann Spectrum
        chData = dataWin(mi,:);
        chData = chData - mean(chData);
        P2 = abs(fft(chData)/nSamples);
        chDataSpctrm = P2(1:nSamples/2+1);
        chDataSpctrm(2:end-1) = 2*chDataSpctrm(2:end-1);
        chDataSpctrm = real(chDataSpctrm);
        chDataSpctrm = chDataSpctrm(~delSel);
        chDataSpctrm(1) = chDataSpctrm(2);
        chDataSpctrm = movmean(chDataSpctrm,10);
        chDataSpctrm = rescale(log10(chDataSpctrm));
        avgDataSpctrm = avgDataSpctrm+chDataSpctrm;

        chDataSpctrmMat(mi,:) = chDataSpctrm;
    end
    avgDataSpctrm = avgDataSpctrm/nrMtgs;
    [p, S] = polyfit(fftFreqs, avgDataSpctrm, polyOrder);
    [avgDataModelY, ~] = polyval(p, fftFreqs, S);

    channSpecNI = zeros(nrMtgs, 1);
    for mi = 1:nrMtgs

        %% NI_1, Channel Spectrum vs Channel Model, catch artefats that don't follow a linear adjustment to teh spctrm
        chDataSpctrm = chDataSpctrmMat(mi,:);
        [p, S] = polyfit(fftFreqs, chDataSpctrm, polyOrder);
        [chSpecModelY, ~] = polyval(p, fftFreqs, S);
        ssr = sum((chDataSpctrm-chSpecModelY).^2);
        sst = sum((chDataSpctrm-mean(chDataSpctrm)).^2);
        chSpecModelR2 = ssr/sst;
        if chSpecModelR2 > 1
            chSpecModelR2 = 1;
        end
        %% NI_2, Channel Model vs Ch.Average Model, catch artifcats based on a clean spectrum (i.e. ch.avg.spctrm)
        ssr = sum((avgDataModelY-chSpecModelY).^2);
        sst = sum((avgDataModelY-mean(avgDataModelY)).^2);
        chSpecChAvgModelsR2 = ssr/sst;
        if chSpecChAvgModelsR2 > 1
            chSpecChAvgModelsR2 = 1;
        end
        %% N_3, Channel Model vs Ideal Model, catch artefacts in case all channels artifactual
        ssr = sum((perfDataModel-chSpecModelY).^2); % Residual Sum-Of-Squares
        sst = sum((perfDataModel-mean(perfDataModel)).^2); % Total Sum-Of-Squares
        avgData_PerfData_R2 = ssr/sst;
        if avgData_PerfData_R2>1
            avgData_PerfData_R2 = 1;
        end

        if chSpecChAvgModelsR2 > avgData_PerfData_R2
            chNI = mean([chSpecModelR2, chSpecChAvgModelsR2]);
        else
            chNI = mean([chSpecModelR2, avgData_PerfData_R2]);
        end
        chNI = mean([chSpecModelR2, chSpecChAvgModelsR2, avgData_PerfData_R2]);
        %chNI = mean([chSpecModelR2, avgData_PerfData_R2]);
        channSpecNI(mi) = chNI;

        ss = 1600*1024;
        chpidx = 3;
        plotOk = (mi == chpidx && startSample > ss-500 && startSample < ss+500);
        if plotOk
            close all;
            subplot(3,4,1)
            chData = dataWin(mi,:);
            plot(time, chData, '-k');
            legend("Chann.Signal")
            title(mtgLabels{mi})
            
            subplot(3,4,5)
            bpChData = getBandpassedSignal(fs, 512, 80, 500,chData);
            plot(time, bpChData, '-k');
            ylim([prctile(bpChData,0.15), prctile(bpChData,99.85)])
            legend("BP Chann.Signal")
            title({strcat("Bandpassed ", mtgLabels{mi}); "(80-500 Hz)"})
            set(gcf, 'Position', get(0, 'Screensize'), 'color','w');
            
            %% N_1
            subplot(3,4,[2 6])
            plot(fftFreqs, chDataSpctrm, '-k'); hold on;
            plot(fftFreqs, chSpecModelY, '-r', 'LineWidth', 2); hold on;
            legend("Chann.Spctrm", "Chann.SpctrmModel");
            titleStr = {"NI_1, Channel Spectrum"; "vs"; "Channel Spectrum Model"; strcat("NI_1 = ", num2str(chSpecModelR2, '%.2f'))};
            title(titleStr)
            
            %% N_2
            subplot(3,4,[3 7])
            plot(fftFreqs, avgDataSpctrm, '-k'); hold on;
            plot(fftFreqs, chSpecModelY, '-r', 'LineWidth', 2); hold on;
            plot(fftFreqs, avgDataModelY, '-g', 'LineWidth', 2); hold on;
            legend("Avg.Chann.Spctrm", "Chann.SpctrmModel", "Avg.Chann.Spctrm.Model");
            titleStr = {"NI_2, Channel Spectrum Model"; "vs"; "Avg.Channel Spectrum Model"; strcat("NI_2 = ", num2str(chSpecChAvgModelsR2, '%.2f'))};
            title(titleStr)
            
            %% N_3
            subplot(3,4,[4 8])
            plot(fftFreqs, chDataSpctrm, '-k'); hold on;
            plot(fftFreqs, chSpecModelY, '-r', 'LineWidth', 2); hold on;
            plot(fftFreqs, perfDataModel, '-m', 'LineWidth', 2); hold on;
            legend("Chann.Spctrm", "Chann.SpctrmModel", "Ideal Spctrm");
            titleStr = {"NI_3, Channel Spectrum Model"; "vs"; "Ideal Spectrum Model"; strcat("NI_3 = ", num2str(avgData_PerfData_R2, '%.2f'))};
            title(titleStr)
            
            sgtitle({mtgLabels{mi}; strcat("Channel Specfic NI:", num2str(chNI, '%.2f'))});
            
            set(gcf, 'Position', get(0, 'Screensize'), 'color','w');
            % figFilename = strcat("F:\Postdoc_Calgary\Presentations\images\", mtgLabels{mi}, '_ChannSpec_N2', '.png');
            % %saveas(gcf,figFilename);
            close();
        end
    end
end

